export const MMReactPlayerSDK = (VideoComponent) => {
    return forwardRef(({    
    url,
    playerRef,
    mmOptions,
    ...props
    }, ref) => {
    var mmPlayerAdapter = new AdapterSingletonClass();

    const {
        register: {
            customerId,
            subscriberId,
            subscriberType,
            subscriberTag,
            playerName,
            playerBrand,
            playerModel,
            playerVersion,
            basePlayerName,
            basePlayerVersion,
            experimentName,
            subPropertyId,
            viewSessionId,
            domainName,
            applicationName,
            applicationVersion,
            deviceMarketingName
        },
        contentMetadata:{
            assetName,
            assetId,
            videoId,
            contentType,
            genre,
            drmProtection,
            episodeNumber,
            season,
            seriesTitle,
            isLive
        },
        customTags,
        enableLogTrace
      } = mmOptions;

      var mmVideoAssetInfo = {
        "assetName": assetName,
        "assetId": assetId,
        "videoId": videoId,
        "contentType": contentType,
        "genre": genre,
        "drmProtection": drmProtection,
        "episodeNumber": episodeNumber,
        "season": season,
        "seriesTitle": seriesTitle,        
        "customTags": customTags
      };

    useEffect(() => {  
        mmPlayerAdapter.enableLogTrace(enableLogTrace)
        if (mmPlayerAdapter.getRegistrationStatus() === false) {
            mmPlayerAdapter.registerMMSmartStreaming(playerName, customerId, subscriberId, domainName, subscriberType, subscriberTag);
            mmPlayerAdapter.reportPlayerInfo(playerBrand, playerModel, playerVersion);
            mmPlayerAdapter.reportAppInfo(applicationName, applicationVersion);
            mmPlayerAdapter.setDeviceInfo(deviceMarketingName);

            mmPlayerAdapter.reportExperimentName(experimentName)            
            mmPlayerAdapter.reportSubPropertyId(subPropertyId)
            mmPlayerAdapter.reportBasePlayerInfo(basePlayerName, basePlayerVersion)
        }        
    }, []);

    // Helper function to merge SDK and application callbacks
    const mergeCallbacks = (sdkCallback, appCallback) => (...args) => {
        if (sdkCallback) sdkCallback(...args); // SDK callback
        if (appCallback) appCallback(...args); // Application callback
    };

    return (
       <VideoComponent
            ref={ref}
            url={url}
            {...props}

            // Merge SDK and application event listeners
            onReady={mergeCallbacks(() => {                
                mmPlayerAdapter.destroy()
                mmPlayerAdapter.reportViewSessionId(viewSessionId)
                mmPlayerAdapter.initialize(url, mmVideoAssetInfo, isLive);         
                mmPlayerAdapter.onPlaybackReady()                
            }, props.onReady)}

            onStart={mergeCallbacks(() => {                
                mmPlayerAdapter.onPlaybackStart()
            }, props.onStart)}

            onPlay={mergeCallbacks(() => {                
                mmPlayerAdapter.onPlaybackPlaying()                
            }, props.onPlay)}

            onPause={mergeCallbacks(() => {                
                mmPlayerAdapter.onPlaybackPause()                
            }, props.onPause)}

            onBuffer={mergeCallbacks(() => {                
                mmPlayerAdapter.onPlaybackBuffer()                
            }, props.onBuffer)}

            onBufferEnd={mergeCallbacks(() => {                
                mmPlayerAdapter.onPlaybackBufferEnd()                
            }, props.onBuffer)}

            onPlaybackRateChange={mergeCallbacks(() => {            
            }, props.onPlaybackRateChange)}

            onSeek={mergeCallbacks((e) => {                
                mmPlayerAdapter.onPlaybackSeek()                
            }, props.onSeek)}

            onEnded={mergeCallbacks(() => {                
                mmPlayerAdapter.onPlaybackEnded()                
            }, props.onEnded)}

            onError={mergeCallbacks((e) => {                
                mmPlayerAdapter.onPlaybackerror(e)                
            }, props.onError)}

            onProgress={mergeCallbacks((e) => {                
                mmPlayerAdapter.onPlaybackProgress(e.playedSeconds)                
            }, props.onProgress)}

            onDuration={mergeCallbacks((duration) => {                
                mmPlayerAdapter.onPlaybackDuration(duration)                
            }, props.onDuration)}            
        />
    );
  });
};